(function($){
    Drupal.behaviors.calenBlock = {
        attach:function (context, settings) {

            isset = function(obj) {
              var i, max_i;
              if(obj === undefined) return false;
              for (i = 1, max_i = arguments.length; i < max_i; i++) {
                if (obj[arguments[i]] === undefined) {
                    return false;
                }
                obj = obj[arguments[i]];
              }
              return true;
            };

          if (isset(settings.row) && settings.row != null && settings.row.calendar.length != 0) {

            var lang = settings.locale, rows = settings.row.calendar, idModal, link=[];
            var windows, modalwin, sumwindow, leftwin, endprop = {};
            var debugMode = true;
      
            function debug(msg) {
                if (!debugMode) { return; }
                if (window.console && window.console.log){
                    window.console.log(msg);
                } else {
                    alert(msg);
                }
            }
            
            moment.locale(lang);
            console.log(rows);
            $.ajax({  
              url: lang+'/mobile-api/calendar/item/'+rows['0'].item.nid,
              cache: false,  
              success: function(html){
                $.each(html.calendar, function(a,andex) {
                  $('.modal-title').html(andex.item.title_field_et);
                  $('.modal-body .time').html(moment(andex.item.start_date).format('D MMMM YYYY'));
                  $('.modal-body .description').html(andex.item.body);
                });  
              }
            });

            dayM = moment(rows['0'].item.start_date).format('D');
            monthM = moment(rows['0'].item.start_date).format('D MMMM')
            monthM = monthM.replace(dayM+' ', '');

            $('#calenTable').hide();
            $('.dateNumber').html(dayM);
            $('.dateMonth').html(monthM);

            $('.linkBlock').html(rows['0'].item.title_field_et);

          } else {
            $('#calenTable').show();
            $('#calenTable').html(Drupal.t('No upcoming events'));
          }
        }
    };

})(jQuery);
